import React from 'react';
import './App.css';
import PrWarmup from './components/PrWarmup';
import ReverseMax from './components/ReverseMax';
import SetPlanner from './components/SetPlanner'

function App() {

  headerStyle = {
    textAlign: 'center',
  }

  return (


    <div className="App">
      <header className="App-header" style={headerStyle}><h1>Liftility</h1></header>
      <PrWarmup/>
      <ReverseMax/>
      <SetPlanner/>
    </div>
  );
}

export default App;
